import React from 'react'
import { makeStyles } from '@material-ui/core'
import { Card } from './carrousel.styles'
import Img1 from '../../assets/home_slider_1.jpg'

export default function Carousel(props) {
    const { img, title } = props.content;

    return (
        <Card img={img}>
            <h1>{title}</h1>
        </Card>
    );
}
